class Solution(object):
    def lengthOfLongestSubstring(self, str):
        longestSubstring = ''
        if len(str) == 1:
            return 1
        elif len(str) == 0:
            return 0
        for i in range(0, len(str)):
            for j in range(i +1, len(str)):
                if j == i + 1:
                    subStr = str[i]
                if str[j] in subStr:
                    if len(subStr) > len(longestSubstring):
                        longestSubstring = subStr
                        break
                    else:
                        break
                else:
                    subStr = subStr + str[j]
            if len(subStr) > len(longestSubstring):
                longestSubstring = subStr
        return len(longestSubstring)

